import { BrowserRouter, Switch, Link } from 'react-router-dom'
import Home from './pages/home/Home';

function App() {
  return (
    <div className="App">
      <Switch>
        <Link to={'/home'} component={Home}/>
      </Switch>

    </div>
  );
}

export default App
